export default function Marker(props, hover) {
  const handleClick = () => {
    console.log(`You clicked on ${props.tooltip}`);
  };

  return (
    <div className={hover ? "circle hover" : "circle"} onClick={handleClick}>
      <span className="circleText" title={props.tooltip}>
        {props.text}
      </span>
    </div>
  );
}
